    "introduce": "Fri, 05 April 2019, 16:00 UTC \u2014 Sat, 06 April 2019, 16:00 UTC\u00a0\n\nA\u00a0\n event.\nFormat: Jeopardy\u00a0\nOfficial URL: \nFuture weight: 37.00\u00a0\nRating weight: 24.88\u00a0\n",
    "organizer_href": "/team/3208",
    "organizer_name": "HackingForSoju",
    "other_introduce": "WHY Midnight Sun CTF\nThe Midnight Sun CTF started as a common interest between Networked Systems Security (NSS) group at KTH, CTF Team HackingForSoju and Saab to promote the cyber security eco-system in the Stockholm region. This is why we connect the Midnight Sun CTF to the CyberSecurity and Privacy (CySeP) summer school and plan to have them each June together.\nWHEN and WHERE\nThe final event is in June (15th-16th) in Stockholm, Sweden, with the online qualifier in April (5th-6th). The final event is hosted by the NSS group at the premises of the School of EECS at the main KTH campus, right after the end of CySeP.\nQUALIFYING\nThe Open class is open to teams from anywhere in the world. The top seven teams of each class respectively proceed to the finals in Stockholm. In the Student class, four of the seven finals spots are reserved for teams from Swedish universities while the remaining three are reserved for teams from the Baltic Sea-8 countries (SE, FI, EE, LT, LV, PL, DE, DK)\nSupported categories are Pwnable, Reverse, Web, Crypto, Misc.\nRead more about the event here: \nRegistrations is open: \nIRC:  #midnightsun @ freenode\n",
    "prizes": "The top 7 teams in each class qualify to the on-site finals in Stockholm in June.",
